import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Example list of time zones
const timezones = [
  "America/New_York",
  "America/Chicago",
  "America/Los_Angeles",
  "Europe/London",
  "Europe/Paris",
  "Asia/Dubai",
  "Asia/Tokyo",
  "Asia/Kolkata",
  "Australia/Sydney",
  "UTC"
];

function App() {
  const [currentUser, setCurrentUser] = useState(null);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [timezone, setTimezone] = useState('');
  const [friendUsername, setFriendUsername] = useState('');
  const [friends, setFriends] = useState([]);
  const [newEvent, setNewEvent] = useState({ title: '', startTime: '', endTime: '' });

  // Register new user with timezone
  const handleRegister = async () => {
    try {
      const response = await axios.post('http://localhost:5000/register', { username, password, timezone });
      setCurrentUser(response.data);
      setUsername('');
      setPassword('');
      setTimezone('');
    } catch (error) {
      alert(error.response.data.message);
    }
  };

  // Login user
  const handleLogin = async () => {
    try {
      const response = await axios.post('http://localhost:5000/login', { username, password });
      setCurrentUser(response.data);
      setUsername('');
      setPassword('');
      const friendsResponse = await axios.get(`http://localhost:5000/friends/${response.data.id}`);
      setFriends(friendsResponse.data);
    } catch (error) {
      alert('Invalid credentials');
    }
  };

  return (
    <div>
      <h1>ScheduleMate</h1>
      {!currentUser ? (
        <div>
          <input
            type="text"
            placeholder="Username"
            value={username}
            onChange={e => setUsername(e.target.value)}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={e => setPassword(e.target.value)}
          />

          {/* Dropdown for Timezone */}
          <select value={timezone} onChange={e => setTimezone(e.target.value)}>
            <option value="">Select Timezone</option>
            {timezones.map(tz => (
              <option key={tz} value={tz}>
                {tz}
              </option>
            ))}
          </select>

          <button onClick={handleLogin}>Login</button>
          <button onClick={handleRegister}>Register</button>
        </div>
      ) : (
        <div>
          <h1>Welcome, {currentUser.username}</h1>
          <button onClick={() => setCurrentUser(null)}>Logout</button>

          <h2>Your Friends</h2>
          <ul>
            {friends.map(friend => (
              <li key={friend.id}>{friend.username}</li>
            ))}
          </ul>

          <h3>Add Event to Your Calendar</h3>
          <input
            type="text"
            placeholder="Event Title"
            value={newEvent.title}
            onChange={e => setNewEvent({ ...newEvent, title: e.target.value })}
          />
          <input
            type="datetime-local"
            placeholder="Start Time"
            value={newEvent.startTime}
            onChange={e => setNewEvent({ ...newEvent, startTime: e.target.value })}
          />
          <input
            type="datetime-local"
            placeholder="End Time"
            value={newEvent.endTime}
            onChange={e => setNewEvent({ ...newEvent, endTime: e.target.value })}
          />
          <button onClick={() => {
            axios.post('http://localhost:5000/add-event', { userId: currentUser.id, ...newEvent })
              .then(response => {
                setNewEvent({ title: '', startTime: '', endTime: '' });
              })
              .catch(error => {
                alert(error.response.data.message);
              });
          }}>Add Event</button>
        </div>
      )}
    </div>
  );
}

export default App;
